import { FiUsers, FiBox } from "react-icons/fi";

const Dashboard = () => {
  return (
    <div className="min-h-screen bg-gray-100 p-6">

      {/* DASHBOARD TITLE */}
      <h1 className="text-2xl font-bold text-gray-900 mb-6">
        Dashboard
      </h1>

      {/* CARDS */}
      <div className="grid grid-cols-1 sm:grid-cols-3 gap-6 w-full">

        {/* NO OF CLIENTS */}
        <div className="bg-white rounded-2xl shadow-sm p-6 flex flex-col items-center gap-3">
          <div className="bg-blue-100 text-blue-600 p-4 rounded-xl text-2xl">
            <FiUsers />
          </div>
          <p className="text-gray-500 text-sm">No of Clients</p>
          <h2 className="text-3xl font-bold text-gray-900">12</h2>
        </div>

        {/* NO OF PRODUCTS */}
        <div className="bg-white rounded-2xl shadow-sm p-6 flex flex-col items-center gap-3">
          <div className="bg-green-100 text-green-600 p-4 rounded-xl text-2xl">
            <FiBox />
          </div>
          <p className="text-gray-500 text-sm">No of Products</p>
          <h2 className="text-3xl font-bold text-gray-900">6</h2>
        </div>

        {/* ONGOING PROJECTS */}
        <div className="bg-white rounded-2xl shadow-sm p-6 flex flex-col items-center gap-3">
          <div className="bg-green-100 text-green-600 p-4 rounded-xl text-2xl">
            <FiBox />
          </div>
          <p className="text-gray-500 text-sm">Ongoing Projects</p>
          <h2 className="text-3xl font-bold text-gray-900">6</h2>
        </div>

      </div>
    </div>
  );
};

export default Dashboard;
